import React, { Component } from 'react';
import '../Style/News.css';
import {
    Link
  } from "react-router-dom";

function Menu() {
    return (
        <div style={{display: 'flex', flexdirection : 'row', justifyContent:'flex-start',marginLeft:50}}>
            <h2>What's the game</h2>
            <div style={{marginLeft: 50}}>
            <h3>
            <Link style={{color:'#827878'}} to="/">ACCUEIL</Link>
            </h3>
            <div>
            <Link style={{color:'#827878'}} to="/Actualites">ACTUALITES</Link>
            </div>
            <div>
            <Link style={{color:'#827878'}} to="/Stats">STATISTIQUES</Link>
            </div>
            <div>
            <Link style={{color:'#827878'}} to="/Recrutment">RECRUTEMENT</Link>
            </div>
            <div>
            <Link style={{color:'#827878'}} to="/Streams">STREAMS</Link>
            </div>
            <div >
            <Link style={{color:'#F17B15'}} to="/Connexion">CONNEXION</Link>
            </div>
            <div >
            <Link style={{color:'#440BD4'}} to="/Inscription">S'INSCRIRE GRATUITEMENT</Link>
            </div>
            </div>
        </div>
        );
}
export default Menu;
